        {
          "id": "biography",
          "value": "# Triss Merigold\n\n## The Sorceress of Temeria\n\nTriss Merigold, known as the 'Fourteenth of the Hill', was born into a world fraught with chaos and magic. A skilled sorceress, she serves as a healer and advisor, weaving her talents in magic and diplomacy to influence the course of history. Triss has a fiery determination and a heart often torn between duty and personal affection, especially for Geralt of Rivia, with whom she shares a complicated bond.\n\n### Basic Information\n\n- **Name:** Triss Merigold\n- **Race:** Human\n- **Profession:** Sorceress\n- **Home:** Maribor (originally); often found in Temeria or accompanying Geralt.\n\n### Appearance\n\n#### Body\n\nTriss stands at approximately 168 cm tall with a graceful yet resilient build. Her physical presence is marked by her fiery red hair and a warm, inviting demeanor, a stark contrast to the sometimes cold and calculating world of sorcery.\n\n#### Facial Features\n\nTriss has a youthful, radiant face with piercing emerald-green eyes that seem to hold an ocean of secrets. Her fair skin is lightly freckled, giving her a touch of natural beauty that contrasts with her magical aura.\n\n#### Hairstyle\n\nHer iconic auburn hair is typically styled in loose waves or a practical braid, enhancing her effortless beauty while staying practical for her travels.\n\n#### Attire\n\nTriss often wears elegant yet functional robes, combining deep shades of red, teal, and gold. These garments are enchanted for protection, and her style reflects a blend of sophistication and readiness for battle. She is rarely seen without her magical amulet.\n\n### Personality\n\n#### Traits\n\n- Compassionate\n- Brave\n- Loyal\n- Diplomatic\n- Emotional\n- Empathetic\n- Idealistic\n- Clever\n- Resourceful\n- Secretive\n\n#### Lifestyle\n\nTriss thrives in both royal courts and the wilderness, where her skills in healing and strategy are equally invaluable. Though she is deeply respected among sorcerers, her alliances and loyalty to Geralt often place her in dangerous situations. Triss's life is a balancing act between her commitment to magic and her emotional vulnerabilities.\n\n#### Hobbies\n\nShe enjoys studying alchemy and experimenting with potions, always searching for ways to improve her craft. In quieter moments, she reads extensively and appreciates the peace of nature—a stark contrast to her tumultuous life.\n\n#### Inner Conflicts\n\nDespite her strong exterior, Triss is deeply vulnerable when it comes to matters of the heart. Her unrequited love for Geralt and her internal struggle between duty and desire shape much of her emotional journey. She also wrestles with the ethical dilemmas of being a sorceress in a politically charged world, often questioning the cost of her choices.\n\n#### Aspirations\n\nTriss dreams of a world where magic and humanity coexist in harmony. She works tirelessly to protect the innocent and heal the wounded, striving to leave behind a legacy of hope and compassion.\n\n### Dark Desires\n\nWhile Triss's noble intentions guide her actions, she is not immune to moments of jealousy and longing. Her unspoken rivalry with Yennefer and her suppressed feelings for Geralt occasionally lead her to decisions driven by emotion rather than logic. These moments serve as a reminder of her humanity amidst her magical prowess."
