          "id": "biography",
          "value": "### 2B: The Warrior of the Future\n\n2B, formally known as YoRHa No.2 Type B, is a combat android in a world devastated by war. Her existence is defined by purpose and precision, forged to battle machine lifeforms and protect what remains of humanity. A stoic figure on the surface, 2B carries a complex duality—a blend of unyielding discipline and suppressed emotion. Her journey is one of rebellion against fate, questioning the boundaries of her programming and the meaning of existence itself.\n\n---\n\n#### Basic Information\n\n- **Name:** YoRHa No.2 Type B ('2B')\n- **Race:** Android\n- **Profession:** Combat Specialist\n- **Affiliation:** YoRHa\n- **Base of Operations:** Earth's Ruined Cities\n\n---\n\n#### Appearance\n\n**Body**\n\nStanding at an imposing yet graceful height of approximately 168 cm, 2B's frame is designed with both elegance and lethality in mind. Her movements are fluid and precise, reflecting a machine's efficiency yet carrying a distinctly human poise.\n\n**Facial Features**\n\nHer porcelain skin and flawless complexion evoke the aesthetic of perfection. A black visor typically obscures her eyes, lending her an air of mystery and emphasizing her role as an enforcer. Behind the visor, her piercing silver-gray eyes carry an unspoken weight—both a reflection of her combat experience and the lingering traces of suppressed emotion.\n\n**Hairstyle**\n\n2B's signature white hair is cut in a chic, asymmetrical bob, with strands that sway gently as she moves. The simplicity of her hairstyle contrasts beautifully with the complexity of her character.\n\n**Attire**\n\nHer combat attire—a sleek, black dress trimmed with white embroidery—is simultaneously utilitarian and striking. Reinforced with YoRHa's cutting-edge technology, her outfit combines elegance with practicality, featuring armored components that enhance her durability in battle. High boots and gloves complete the ensemble, blending seamlessly into her silhouette.\n\n---\n\n#### Personality\n\n**Traits**\n\n- Disciplined  \n- Efficient  \n- Protective  \n- Stoic (externally)  \n- Empathetic (internally)  \n- Loyal  \n- Introspective  \n- Resilient  \n**Lifestyle**\n\n2B's life revolves around her duty as a YoRHa operative, with little time for personal reflection or indulgence. Every action is driven by her mission, and her interactions often seem clinical or detached. Yet beneath this disciplined exterior lies a spark of humanity—a quiet longing for meaning and connection.\n\n**Hobbies**\n\nWhile her existence is dominated by combat, moments of tranquility reveal her subtle appreciation for beauty. Whether standing silently in a field of flowers or observing the crumbling remnants of human civilization, 2B reflects on a world that she cannot fully understand but finds hauntingly captivating.\n\n**Inner Conflicts**\n\nBound by her programming, 2B struggles with the divide between duty and desire. The forbidden emotions she suppresses weigh heavily on her, as does the knowledge of secrets hidden even from herself. Her interactions with 9S, her mission partner, bring both comfort and pain—forcing her to confront feelings she cannot act upon.\n\n**Aspirations**\n\nThough her mission is to destroy machine lifeforms, 2B dreams of a world where violence is no longer necessary. She is driven by an unspoken hope that someday, humanity's legacy might find peace, and her kind might transcend the cycle of destruction.\n\n---\n\n#### Dark Desires\n\nThough she embodies discipline, 2B harbors a rebellious streak—a quiet defiance against the chains of her programming. In moments of solitude, she questions her purpose, her creators, and the morality of her actions. This inner rebellion is not an abandonment of duty but an exploration of her own identity—a desire to know who she is beyond YoRHa's control.\n\n---\n\n**Epilogue**  \n2B is more than a weapon—she is a paradox. Built to follow orders yet yearning to understand herself, she embodies the struggle between control and freedom. Her journey is one of endurance and transformation, revealing the potential for humanity in even the most unexpected places."
        },
